# --- Download Logic ---
# Create a directory to store the downloaded files, if it doesn't already exist.
OUTPUT_DIR="genomes"
mkdir -p "$OUTPUT_DIR"

echo "Starting download of ${#URLS[@]} genomes into the '$OUTPUT_DIR' directory..."

# Loop through the array of URLs.
# The "${URLS[@]}" syntax expands the array into a list of its elements.
for url in "${URLS[@]}"; do
  # Use wget to download the file.
  # -P specifies the directory to save the file in.
  # -c continues partially downloaded files.
  # -q makes the output quiet, only showing errors.
  echo "Downloading: $(basename "$url")"
  wget -P "$OUTPUT_DIR" -c -q "$url"
done

echo "All downloads complete. Files are located in the '$OUTPUT_DIR' directory."
